import React from "react";

class Nav extends React.Component {
  render() {
    return (
        <nav className="navbar navbar-expand-lg bg-body-tertiary fixed-top">
          <div className="container">
            <a className="navbar-brand m-auto" href="index.html">
              Facegram
            </a>
          </div>
        </nav>
    );
  }
}

export default Nav;
